import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Hello from "./component/Hello/Hello";
import Counter from "./component/Counter/Counter";
const names = [
  "Adit",
  "didit",
  "aditya"
]
function App() {
  return (
    <div>
     {names.map(newName => <Hello name={newName}/> )}
      <br></br>
      <Counter min={0} max={60} />
    </div>
  );
}

export default App;
